import React from 'react';
import './App.css';
import NavBar from './misc/NavBar';
import Card from './components/Cards';
import Login from './components/login';
import Register from './components/Register';
import { R} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <switch>
      <div>
          <NavBar />
          <Card />
          <Login />
          <Register />
        </div>
      </switch>


    </div>
  );
}

export default App;
